func removeStarsTailRe(s string) string {
	return removeStarsHelper(s, "")
}

// removeStarsHelper 是 removeStars 的辅助函数，使用尾递归。
func removeStarsHelper(s string, acc string) string {
	if !strings.Contains(s, "*") {
		return acc + s
	}

	idx := strings.Index(s, "*")

	if idx == -1 {
		// 没有 '*'，直接返回累积的结果加上剩余的字符串
		return acc + s
	}

	// 如果 '*' 是第一个字符，直接移除 '*' 并继续递归
	if idx == 0 {
		return removeStarsHelper(s[idx+1:], acc[:len(acc)-1])
	}

	// 移除 '*' 及其前一个字符
	newAcc := acc + s[:idx-1]
	remaining := s[idx+1:]

	return removeStarsHelper(remaining, newAcc)
}

